import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Planets from "./components/Planets";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<h1>Home Page</h1>} />
        <Route path="/planets" element={<Planets />} />
      </Routes>
    </Router>
  );
}

export default App;
